answer:
We can factor the given expression as follows:

\begin{align*}
x^8 + 3x^4 - 4 &= (x^4 + 4)(x^4 - 1) \\
&= (x^4 + 4)(x^2 + 1)(x^2 - 1) \\
&= (x^4 + 4)(x^2 + 1)(x + 1)(x - 1).
\end{align*}

Since each of the factors is monic with integer coefficients and cannot be factored further over the integers, we have $p_1(x) = x^4 + 4$, $p_2(x) = x^2 + 1$, $p_3(x) = x + 1$, and $p_4(x) = x - 1$. Therefore, the desired sum is

\begin{align*}
p_1(1) + p_2(1) + p_3(1) + p_4(1) &= (1^4 + 4) + (1^2 + 1) + (1 + 1) + (1 - 1) \\
&= 5 + 2 + 2 + 0 \\
&= \boxed{9}.
\end{align*}

Answer: [9]

